<!doctype html>
<html lang="en">
<head>
    <meta http-equiv="Content-Type" content="text/html; charset=utf-8"/>
    <meta name="viewport"
          content="width=device-width, user-scalable=no, initial-scale=1.0, maximum-scale=1.0, minimum-scale=1.0">
    <meta http-equiv="X-UA-Compatible" content="ie=edge">
    <title>Invoice</title>
    <style>

        html {
            font-family: ui-sans-serif, system-ui, -apple-system, BlinkMacSystemFont, "Segoe UI", Roboto, "Helvetica Neue", Arial, "Noto Sans", sans-serif, "Apple Color Emoji", "Segoe UI Emoji", "Segoe UI Symbol", "Noto Color Emoji";
            line-height: 1.5;
        }

        .text-2xl {
            font-size: 1.5rem;
            line-height: 2rem;
        }

        .font-bold {
            font-weight: 700;
        }

        .p-16 {
            padding: 4rem;
        }

        .mx-auto {
            margin-left: auto;
            margin-right: auto;
        }

        .px-3 {
            padding-left: 0.75rem;
            padding-right: 0.75rem;
        }

        .mb-8 {
            margin-bottom: 2rem;
        }

        .justify-between {
            justify-content: space-between;
        }

        .items-center {
            align-items: center;
        }

        .flex {
            display: flex;
        }

        .text-right {
            text-align: right;
        }

        .border-t-2 {
            border-top-width: 2px;
        }

        .border {
            border-width: 1px;
        }

        .border-gray-200 {
            border-color: rgba(229, 231, 235, 1);
        }

        .py-2 {
            padding-top: 0.5rem;
            padding-bottom: 0.5rem;
        }

        .mb-4 {
            margin-bottom: 1rem;
        }

        .bg-gray-200 {
            background-color: rgba(229, 231, 235, 1);
        }

        .mb-2 {
            margin-bottom: 0.5rem;
        }

        .items-center {
            align-items: center;
        }

        .justify-end {
            justify-content: flex-end;
        }

        .text-4xl {
            font-size: 2.25rem;
            line-height: 2.5rem;
        }

        .text-center {
            text-align: center;
        }

        .text-sm {
            font-size: 0.875rem;
            line-height: 1.25rem;
        }
    </style>
</head>
<body>
<table style="width:50vw;border-collapse: collapse;" class="px-3 mx-auto">
    <tr>
        <td style="vertical-align: top">
            <div>
                <p class="text-2xl font-bold" style="margin-bottom: 0;">{{$invoice->invoice_no}}</p>
                <span>{{date('j F Y H:i',strtotime($invoice->created_at))}}</span><br/>
            </div>
        </td>
        <td style="vertical-align: top">
            <img width="128" style="float: right"
                 src="data:image/png;base64,"/>
        </td>
    </tr>
</table>

<table style="width:50vw;border-collapse: collapse; margin-top: 24px; margin-bottom: 24px;" class="px-3 mx-auto">
    <tr>
        <td style="vertical-align: top">
            <b>Dibayar oleh : </b><br/>
            {{$invoice->payer_name}}<br/>
            {{$invoice->bank_name}}<br/>
            {{$invoice->account_no}} (a.n. {{$invoice->account_name}})<br/>
        </td>
        <td style="vertical-align: top">
            <div style="float:right;">
                <b>Dibuat oleh : </b><br/>
                {{$invoice->creator_name}}<br/>
            </div>
        </td>
    </tr>
</table>
<hr style="width:50vw; margin-top: 24px; margin-bottom: 24px;" class=" mx-auto"/>
<table style="width:50vw;border-collapse: collapse;" class=" mx-auto">
    <tr style="background-color: rgb(229, 231, 235);">
        <td style="border:1px solid rgb(229, 231, 235);padding:8px">PO Pendaftaran Bionix</td>
        <td style="border:1px solid rgb(229, 231, 235);padding:8px" class="text-right font-medium">
            Rp {{number_format($invoice->nominal,2,',','.')}}
        </td>
    </tr>
    <tr>
        <td class="text-2xl leading-none" style="padding:8px">Total:</td>
        <td class="text-2xl text-right font-medium" style="padding:8px">Rp {{number_format($invoice->nominal,2,',','.')}}</td>
    </tr>
</table>
<div class="px-0 leading-tight mx-auto" style="width: 50vw;">
    <small class="text-xs" style="color: #c53030;"><i>"Gunakan nomor invoice di atas pada saat melakukan pembayaran pada dashboard
            BIONIX. Jaga baik-baik nomor invoice agar tidak digunakan oleh orang lain."</i></small>
</div>

<div class="mb-8 text-4xl text-center px-3">
    <span>Thank you!</span>
</div>

<div class="text-center text-sm px-3">
    Exported on {{date('j F Y H:i')}}
</div>
</div>
</body>
</html>
